                            if($scattersCount >= 3 && $postData['slotEvent'] == 'freespin')
                                continue;
                            if( $scattersCount >= 3 && $slotSettings->slotBonus ) 
                            {
                                $gameState = 'FreeSpins';
                                $bonusSymbol = rand(1, 8) . '';
                                $splitCnt = rand(3,5);
                                $splitPos = [];
                                while(count($splitPos) < $splitCnt)
                                {
                                    $pos = rand(0, 14);
                                    if(!in_array($pos, $splitPos))
                                        $splitPos[] = $pos;
                                }
                                $freespinImprovements = [];
                                foreach($splitPos as $pos)
                                {
                                    $freespinImprovements[] = [$pos, 0];                                    
                                }
                                
                                $spinData = [
                                    'type' => 'Bonus',
                                    'bonusName' => 'FreeSpins',
                                    'type' => 'Bonus',
                                    'wonSymbols' => $scattersPos,
                                    'params' => [
                                        'bonusSymbol' => $bonusSymbol,
                                        'freeSpins' => '10',
                                        'freeSpinsReelsImprovement' => $freespinImprovements
                                    ]
                                ];
                                // $scw = '{"type":"Bonus","bonusName":"FreeSpins","params":{"freeSpins":"' . $slotSettings->slotFreeCount . '"},"amount":"' . $slotSettings->FormatFloat($scattersWin) . '","wonSymbols":[' . implode(',', $scattersPos) . ']}';
                                $scw = json_encode($spinData);
                                array_push($lineWins, $scw);
                            }
                            // else if( $scattersCount >= 2 ) 
                            // {
                            //     $scw = '{"wonSymbols":[' . implode(',', $scattersPos) . '],"amount":"' . $slotSettings->FormatFloat($scattersWin) . '","type":"WinAmount"}';
                            //     array_push($lineWins, $scw);
                            // }
                            $totalWin += ($scattersWin + $scattersWinB);

                            if($minTotalWin == -1 || ($totalWin > 0 && $totalWin < $minTotalWin))
                            {
                                $minLineWins = $lineWins;
                                $minReels = $reels;
                                $minTotalWin = $totalWin;
                                $minScattersCount = $scattersCount;
                                $minDividingReelsView_ = $DividingReelsView_;
                                $minfreespinImprovements = $freespinImprovements;
                                $minBonusSymbol = $bonusSymbol;
                            }

                            if($this->debug)
                            {
                                $spinAcquired = true;
                                break;
                            }                    
                            if($totalWin <= $spinWinLimit && (($totalWin > 0 && $winType != 'none') || ($winType == 'bonus' && $scattersCount >= 3)))
                            {
                                $spinAcquired = true;
                                if($totalWin < 0.5 * $spinWinLimit && $winType != 'bonus')
                                    $spinAcquired = false;
                                if($spinAcquired)
                                    break;                                        
                            }
                            else if($winType == 'none' && $totalWin == 0)
                            {
                                break;
                            }
                        }
                        
                        if($totalWin > 0 && !$spinAcquired)
                        {
                            $lineWins = $minLineWins;
                            $reels = $minReels;
                            $totalWin = $minTotalWin;
                            $scattersCount = $minScattersCount;
                            $DividingReelsView_ = $minDividingReelsView_;
                            $freespinImprovements = $minfreespinImprovements;
                            $bonusSymbol = $minBonusSymbol;
                        }

                        if($postData['slotEvent'] == 'freespin')
                        {
                            $slotSettings->SetGameData($slotSettings->slotId . 'LastReels', $reels);
                        }

                        if( $totalWin > 0 ) 
                        {
                            $slotSettings->SetBank((isset($postData['slotEvent']) ? $postData['slotEvent'] : ''), -1 * $totalWin);
                            $slotSettings->SetBalance($totalWin);
                            $slotSettings->SetWin($totalWin);
                        }
                        $reportWin = $totalWin;
                        if( $postData['slotEvent'] == 'freespin' ) 
                        {
                            $slotSettings->SetGameData($slotSettings->slotId . 'BonusWin', $slotSettings->GetGameData($slotSettings->slotId . 'BonusWin') + $totalWin);
                            $slotSettings->SetGameData($slotSettings->slotId . 'TotalWin', $slotSettings->GetGameData($slotSettings->slotId . 'TotalWin') + $totalWin);
                        }
                        else
                        {
                            $slotSettings->SetGameData($slotSettings->slotId . 'TotalWin', $totalWin);
                        }
                        if( $scattersCount >= 3 ) 
                        {
                            if( $slotSettings->GetGameData($slotSettings->slotId . 'FreeGames') > 0 ) 
                            {
                                $slotSettings->SetGameData($slotSettings->slotId . 'FreeGames', $slotSettings->GetGameData($slotSettings->slotId . 'FreeGames') + $slotSettings->slotFreeCount);
                            }
                            else
                            {
                                $slotSettings->SetGameData($slotSettings->slotId . 'FreeStartWin', $totalWin);
                                $slotSettings->SetGameData($slotSettings->slotId . 'BonusWin', $totalWin);
                                $slotSettings->SetGameData($slotSettings->slotId . 'FreeGames', $slotSettings->slotFreeCount);
                                $slotSettings->SetGameData($slotSettings->slotId . 'BonusSymbol', $bonusSymbol);
                                $slotSettings->SetGameData($slotSettings->slotId . 'FreespinImprovements', $freespinImprovements);
                            }
                        }
                        $spinResultStage2 = '';
                        if( $ImprovementCount >= 10 ) 
                        {
                            $ImprovementCount = -1;
                            $gameState = 'DividingReels';
                            $r2View = [];
                            $DividingReelsView = [];
                            for( $i = 0; $i < count($DividingReels); $i++ ) 
                            {
                                if( $DividingReels[$i] != 'null' ) 
                                {
                                    $DividingReelsView[] = $DividingReels[$i];
                                    $r2View[] = [
                                        [
                                            '"' . rand(0, 7) . '"', 
                                            '"' . rand(0, 7) . '"'
                                        ], 
                                        [
                                            '"' . rand(0, 7) . '"', 
                                            '"' . rand(0, 7) . '"'
                                        ]
                                    ];
                                }
                                else
                                {
                                    $r2View[] = '"' . rand(0, 7) . '"';
                                }
                            }
                            $spinResultStage2 = ',"spinResultStage2":{"type":"SpinResult","rows":[' . json_encode($r2View) . ']}';
                            $scw = '{"type":"Bonus","bonusName":"ReelsImprovement","params":{"spinsLeft":"0","spinsTotal":"10"},"amount":"0.00","wonSymbols":[' . implode(',', $DividingReelsView) . ']}';
                            array_push($lineWins, $scw);
                        }
                        else if( $ImprovementCount < 10 && $ImprovementCount >= 0 ) 
                        {
                            $scw = '{"type":"Bonus","bonusName":"ReelsImprovement","params":{"spinsLeft":"' . (10 - $ImprovementCount) . '","spinsTotal":"10"},"amount":"0.00","wonSymbols":""}';
                            array_push($lineWins, $scw);
                        }
                        $slotSettings->SetGameData($slotSettings->slotId . 'ImprovementCount', $ImprovementCount);
                        $slotSettings->SetGameData($slotSettings->slotId . 'DividingReels', $DividingReels);
                        $jsSpin = '' . json_encode($reels) . '';
                        $jsJack = '' . json_encode($slotSettings->Jackpots) . '';
                        if( count($lineWins) > 0 ) 
                        {
                            $winString = ',"slotWin":{"totalWin":"' . $totalWin . '","lineWinAmounts":[' . implode(',', $lineWins) . '],"canGamble":"false"}';
                        }
                        else
                        {
                            $winString = '';
                        }
                        $response = '{"responseEvent":"spin","responseType":"' . $postData['slotEvent'] . '","serverResponse":{"BonusSymbol":' . $slotSettings->GetGameData($slotSettings->slotId . 'BonusSymbol') . ',"slotLines":' . $lines . ',"slotBet":' . $betLine . ',"totalFreeGames":' . $slotSettings->GetGameData($slotSettings->slotId . 'FreeGames') . ',"currentFreeGames":' . $slotSettings->GetGameData($slotSettings->slotId . 'CurrentFreeGame') . ',"Balance":' . $slotSettings->GetBalance() . ',"afterBalance":' . $slotSettings->GetBalance() . ',"bonusWin":' . $slotSettings->GetGameData($slotSettings->slotId . 'BonusWin') . ',"freeStartWin":' . $slotSettings->GetGameData($slotSettings->slotId . 'FreeStartWin') . ',"totalWin":' . $totalWin . ',"winLines":[],"bonusInfo":[],"Jackpots":' . $jsJack . ',"reelsSymbols":' . $jsSpin . '}}';
                        $slotSettings->SaveLogReport($response, $allbet, $reportWin, $postData['slotEvent']);

                        if( $postData['slotEvent'] == 'freespin' ) 
                        {
                            if( $reqId == 'DividingReelsRequest' ) 
                            {
                                $slotSettings->SetGameData($slotSettings->slotId . 'DividingReels', [
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null', 
                                    'null'
                                ]);
                                $lines = implode(',', $lineWins);
                                if($lines != '')
                                    $lines = ', '. $lines;
                                $result_tmp[] = '{"action":"DividingReelsResponse","result":"true","sesId":"10000003010","data":{"slotWin":{"lineWinAmounts":[{"type":"Bonus","bonusName":"ReelsImprovement","params":{"spinsLeft":"0","spinsTotal":"10"},"amount":"0.00","wonSymbols":""}'.$lines.'],"totalWin":"'.$totalWin.'","canGamble":"false"},"spinResult":{"type":"SpinResult","rows":[[' . implode(',', $DividingReelsView_) . ']]},"totalBonusWin":"0","freeSpinRemain":"0","freeSpinsTotal":"1","state":"Ready"}}';
                            }
                            else
                            {
                                $gameState = 'FreeSpins';
                                $bonusWin0 = $slotSettings->GetGameData($slotSettings->slotId . 'BonusWin');
                                $freeSpinRemain = $slotSettings->GetGameData($slotSettings->slotId . 'FreeGames') - $slotSettings->GetGameData($slotSettings->slotId . 'CurrentFreeGame');
                                if($freeSpinRemain < 1)
                                    $gameState = 'Ready';
                                $freeSpinsTotal = $slotSettings->GetGameData($slotSettings->slotId . 'FreeGames');
                                $result_tmp[] = '{"action":"FreeSpinResponse","result":"true","sesId":"10000228087","data":{"state":"' . $gameState . '"' . $winString . ',"spinResult":{"type":"SpinResult","rows":[[' . implode(',', $DividingReelsView_) . ']]},"totalBonusWin":"' . $slotSettings->FormatFloat($bonusWin0) . '","freeSpinRemain":"' . $freeSpinRemain . '","freeSpinsTotal":"' . $freeSpinsTotal . '"}}';
                                $slotSettings->SetGameData($slotSettings->slotId . 'FreespinReels', $DividingReelsView_);
                            }
                        }
                        else
                        {
                            $symb = '["' . $reels['reel1'][0] . '","' . $reels['reel1'][1] . '","' . $reels['reel1'][2] . '","' . $reels['reel2'][0] . '","' . $reels['reel2'][1] . '","' . $reels['reel2'][2] . '","' . $reels['reel3'][0] . '","' . $reels['reel3'][1] . '","' . $reels['reel3'][2] . '","' . $reels['reel4'][0] . '","' . $reels['reel4'][1] . '","' . $reels['reel4'][2] . '","' . $reels['reel5'][0] . '","' . $reels['reel5'][1] . '","' . $reels['reel5'][2] . '"]';
                            $result_tmp[] = '{"action":"SpinResponse","result":"true","sesId":"10000373695","data":{"spinResult":{"type":"SpinResult","rows":[' . $symb . ']}' . $winString . ',"state":"' . $gameState . '"' . $spinResultStage2 . '}}';
                        }
                        break;
                }
                $response = implode('------', $result_tmp);
                $slotSettings->SaveGameData();
                $slotSettings->SaveGameDataStatic();
                DB::commit();
                echo ':::' . $response;
            }
            catch( \Exception $e ) 
            {
                if( isset($slotSettings) ) 
                {
                    $slotSettings->InternalErrorSilent($e);
                }
                else
                {
                    $strLog = '';
                    $strLog .= "\n";
                    $strLog .= ('{"responseEvent":"error","responseType":"' . $e . '","serverResponse":"InternalError","request":' . json_encode($_REQUEST) . ',"requestRaw":' . file_get_contents('php://input') . '}');
                    $strLog .= "\n";
                    $strLog .= ' ############################################### ';
                    $strLog .= "\n";
                    $slg = '';
                    if( file_exists(storage_path('logs/') . 'GameInternal.log') ) 
                    {
                        $slg = file_get_contents(storage_path('logs/') . 'GameInternal.log');
                    }
                    file_put_contents(storage_path('logs/') . 'GameInternal.log', $slg . $strLog);
                }
            }
        }
    }

}
